      // Calculate total Visible Listing
      function getTotalJobListing() {
        var toList = 0;
        var totList = 0;

        $(".row-job-listing").each(function(){
          totList = totList + 1;
          if($(this).is(":visible")) {
            toList = toList + 1;
          }
        })

        $(".gc-jobs-opening span").html(toList)
        $(".gc-total-listing-size .visible-listing").html(toList)
        $(".gc-total-listing-size .total-listing").html(totList)
      }
      

      function filterUpdateList() {
        $(".row-job-listing").hide();
          var totalList = 0;

          if($("input[name='job-location']:checked").length > 0) {
            $("input[name='job-location']:checked").each(function(){
              var locAttr = $(this).attr("value");
              if($("input[name='job-department']:checked").length > 0) {
                $("input[name='job-department']:checked").each(function() {
                  var depAttr = $(this).attr("value");
                  $(".row-job-listing").each(function(){
                    if($(this).attr("data-location").includes(locAttr) && $(this).attr("data-department").includes(depAttr)){
                      $(this).show();
                    }
                  })
                });
              } else {
                $(".row-job-listing").each(function(){
                  if($(this).attr("data-location").includes(locAttr)){
                    $(this).show();
                  }
                })
              }
            });
          }
          else {
            if($("input[name='job-department']:checked").length > 0) {
              $("input[name='job-department']").each(function(){
                if($(this).is(':checked')) {
                  var locAttr = $(this).attr("value");
                  $(".row-job-listing").each(function(){
                    if($(this).attr("data-department").includes(locAttr)) {
                      $(this).show();
                    }
                  })
                }
              });
            }
          }

          if(($("input[name='job-location']:checked").length == 0) && ($("input[name='job-department']:checked").length == 0)) {
            $(".row-job-listing").show();
          }
          getTotalJobListing()
      }

      //Filters on click
      function filterSet() {
        $(".listing-filters input[type='checkbox']").change(function() {
          filterUpdateList()
        });
      }

      // Default Search 
      function searchFiltering() {
        var searchValue = $(".gc-search-wrapper input[type='text']").val();
        $(".filters-set input[type='checkbox']").prop('checked', false)
          $(".row-job-listing").each(function(){
            var curRow = $(this);
            var listingTitle = $(this).attr("data-title");
            listingTitle = listingTitle.toLowerCase();
            searchValue = searchValue.toLowerCase();
            if(listingTitle.includes(searchValue)) {
              curRow.show();
              getTotalJobListing();
            } else {
              curRow.hide();
              getTotalJobListing();
            }
          })

          if($(".gc-search-wrapper input[type='text']").val() == "") {
            $(".row-job-listing").show()
            getTotalJobListing();
          }   
      }

